package Map;
import java.util.TreeMap;
public class Treemap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TreeMap<Integer, String> codes= new TreeMap<>();
		codes.put(44, "UK");
		codes.put(91, "India");
		codes.put(1, "USA");
		System.out.println("Sorted codes:"+ codes);
		

	}

}
